const Styles = styled.div`
background:rgb(241,18,37);
color: #000;
height: 5vh;
display:flex;
flex-direction:row;
align-items:center;
`;

function NavBar() {
    return(
        <React.Fragment>
            <Styles>
             <p style={{alignSelf:'flex-start'}}>Contactez nous : 0557932082</p>   
             <p style={{alignSelf:'flex-end'}}>N1 en ventes des pneus en Algerie</p>
            </Styles>
        </React.Fragment>
    )
}

export default NavBar;
